    <!-- <script src="/js/qrcode.min.js"></script>-->
    <!-- <script src="/js/JsBarcode.all.min.js"></script>-->
    <script>
        var errorMsg = <?=json_encode($errorMsg)?>;
        var isTpl = <?=json_encode($isTpl)?>;
        var printTpl = <?=json_encode($printTpl)?>;
        var tplParams = <?=json_encode($tplParams)?>;
        var htmlContent = <?=json_encode($htmlContent)?>;
        var pageWidth = <?=$pageWidth?>;
        var pageHeight = <?=$pageHeight?>;
    </script>
    <style>
        body {
            font-family: -apple-system, BlinkMacSystemFont,"Microsoft YaHei", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
            margin: 0;
        }
        .ticket {
            height: auto;
            font-size: 20px;
            line-height: 1.5em;
            margin: 0 !important;
            font-weight: 400;
        }
        .page{
            /** 小票打印，最后页尾出纸距离 **/
            padding-bottom: 10mm;
            background: white;
        }

        .ticket-58 {
            width: 370px;
        }

        .ticket-68 {
            width: 464px;
        }

        .ticket-80 {
            width: 560px;
        }

        .font-title {
            font-size: 30px;
        }

        .line_01 {
            padding: 0 20px 0;
            margin: 20px 0;
            line-height: 1px;
            border-left: 190px solid #ddd;
            border-right: 190px solid #ddd;
            text-align: center;
        }


        .text-left {
            text-align: left
        }

        .text-right {
            text-align: right
        }

        .text-center {
            text-align: center
        }

        .text-justify {
            text-align: justify
        }

        .text-nowrap {
            white-space: nowrap
        }

        .text-lowercase {
            text-transform: lowercase
        }

        .text-uppercase {
            text-transform: uppercase
        }

        .text-capitalize {
            text-transform: capitalize
        }
    </style>
</head>
<body class="ticket" style='width: <?=$pageWidth ? ($pageWidth . 'px') : 'auto' ?>'>
<div id="pages">
    
</div>
</div>
<script type="text/javascript">
    function processHtml(html) {
        var el = $('#pages');
        el.html(html);

        var defaultQrcodeOption = {
            text: "",
            width: 128,
            height: 128,
            colorDark : "#000000",
            colorLight : "#ffffff",
            correctLevel : QRCode.CorrectLevel.H
        };
        
        $('.qrcode').each(function(){
            var item = $(this);
            var userOption = item.data();
            var option = $.extend({},defaultQrcodeOption,userOption);
            new QRCode(this, option);
        });
        
        var defaultBarcodeOption = {
            height: 35,
            displayValue: true
        };

        $('.barcode').each(function(){
            var item = $(this);
            var t = $('<canvas />').appendTo(item);
            var userOption = item.data();
            var option = $.extend({},defaultBarcodeOption,userOption);
            JsBarcode(t.get(0), option.text, option);
        })
    }

    if(errorMsg){
        processHtml('<div class="page">' + "<h4>"+errorMsg+"</h4>"+ '</div>');
    }else if(!isTpl){
        processHtml(htmlContent);
    }else{
        try{
            var renderFunc = _.template('<div class="page">' + printTpl.tpl_content + '</div>'+ '</div>');
            
            if(!(tplParams instanceof Array)){
                tplParams = [tplParams];
            }
            var pages = [];
            for(var index in tplParams){
                pages.push(renderFunc(tplParams[index]));
            }
            processHtml(pages.join(''));
        }catch (e) {
            console.log(e);
            processHtml('<div class="page">' +"<h4>渲染模板错误："+e.toString()+"</h4>"+ '</div>');
        }
    }
</script>
</body>
</html>

